export default {
  items: [
    {
      name: 'Формы',
      url: '/forms',
      icon: 'icon-list',
    },
    {
      name: 'Base',
      url: '/base',
      icon: 'icon-puzzle',
      children: [
        {
          name: 'Breadcrumbs',
          url: '/base/breadcrumbs',
          icon: 'icon-puzzle',
        },
      ],
    },
  ],
};
